const { expect } = require("chai")
const { getNamedAccounts, deployments, ethers, network } = require("hardhat")
const { devNetworks } = require("../../helper-hardhat-config")


const lowSVGImageURI = "data:image/svg+xml;base64,"

const highSVGImageURI = "data:image/svg+xml;base64,"



const lowSVGTokenURI = "data:application/json;base64,"

const highSVGTokenURI = "data:application/json;base64,"



!devNetworks.includes(network.name) ? describe.skip

: describe("Testing DynamicSVGNFT Contract", () => {


    let deployer, dynamicSvgNft, mockV3Aggregator


    beforeEach("Deploying DynamicSVGNFT Contract...", async() => {

        deployer = (await getNamedAccounts()).deployer

        await deployments.fixture(["all"])

        dynamicSvgNft = await ethers.getContract("DynamicSVGNFT", deployer)

        mockV3Aggregator = await ethers.getContract("MockV3Aggregator", deployer)
    })

    describe("constructor", () => {

        it("It should have a correct name and symbol", async() => {

            const name = await dynamicSvgNft.name()

            const symbol = await dynamicSvgNft.symbol()

            expect(name.toString()).to.equal("Smilies-Club")

            expect(symbol.toString()).to.equal("Smilie")
        })

        it("It should initialize the tokenCounter, priceFeed, lowSVG and highSVG correctly ", async() => {

            const tokenCounter = await dynamicSvgNft.getTokenCounter()

            const priceFeed = await dynamicSvgNft.getPriceFeed()

            const lowSVG = await dynamicSvgNft.getLowSVG()

            const highSVG = await dynamicSvgNft.getHighSVG()

            expect(tokenCounter).to.equal(0)

            expect(priceFeed).to.equal(mockV3Aggregator.address)

            expect(lowSVG.toString()).to.equal(lowSVGImageURI)

            expect(highSVG.toString()).to.equal(highSVGImageURI)
        })
    })

    describe("mintNft", () => {

        it("It should update the tokenCounter and mint an NFT", async() => {

            const beforeMintingDeployerBalance = await dynamicSvgNft.balanceOf(deployer)

            const highValue = ethers.utils.parseEther("1000")

            await dynamicSvgNft.mintNft(highValue)

            const afterMintingDeployerBalance = await dynamicSvgNft.balanceOf(deployer)

            const updatedTokenCounter = await dynamicSvgNft.getTokenCounter()

            expect(afterMintingDeployerBalance.toString()).to.equal(beforeMintingDeployerBalance.add(1).toString())

            expect(updatedTokenCounter).to.equal(1)
        })

        it("It should emit an event after minting an NFT", async() => {

            const highValue = ethers.utils.parseEther("1000")

            await expect(dynamicSvgNft.mintNft(highValue)).to.emit(dynamicSvgNft, "NFTMinted")
        })
    })

    describe("tokenURI", () => {

        it("It should have a lowSVGTokenURI, If price of ETH is currently below the highValue", async() => {

            const highValue = ethers.utils.parseEther("10000")  // 10,000 $ per ETH

            await dynamicSvgNft.mintNft(highValue)

            const tokenURI = await dynamicSvgNft.tokenURI(0)

            expect(tokenURI.toString()).to.equal(lowSVGTokenURI)
        })

        it("It should have a highSVGTokenURI, If price of ETH is currently above the highValue", async() => {

            const highValue = ethers.utils.parseEther("100")  // 100 $ per ETH

            await dynamicSvgNft.mintNft(highValue)

            const tokenURI = await dynamicSvgNft.tokenURI(0)

            expect(tokenURI.toString()).to.equal(highSVGTokenURI)
        })

        it("It should revert, If tokenURI is Non Existent", async() => {

            await expect(dynamicSvgNft.tokenURI(0)).to.be.revertedWith("URI_QUERY_FOR_NON_EXISTENT_TOKEN")
        })
    })
})